import React from 'react'
import {Wrapper} from '../styled'
import styled from 'react-styled-components'

const ValueCard = styled.div`
    display:flex;
    flex-direction:column;
    height:20em;
    width:15em;
    border: 10px solid black;
` 

export default function Values() {
    return (
        <Wrapper>
            <ValueCard>
                minimal
            </ValueCard>
            <ValueCard>
                mobile first 
            </ValueCard>
            <ValueCard>
                component based
            </ValueCard>



        </Wrapper>
    )
}
